import { object } from "prop-types";


let routes;

 let data = JSON.parse(localStorage.getItem('user'));



 if (Object.keys(data).length > 0) {
  if (data[0].IDLOGIN === 'TES0001') {
    routes =  [
      {
        path: "/index",
        name: "Master Report",
        icon: "ni ni-laptop text-blue",
